import React, {useState, useEffect} from 'react';
import Togglebutton from './Togglebutton';
import './Diagnose.css'


function Diagnose(){

    const [data, setData] = useState([{}]);
    var letter = ""

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                // console.log(data)
            }
        )  
    }, [])

    const diagnose=()=> {
    }

    return (
        <div className='Diagnose-page'>
            <div> 
                <h1>Select Symptoms: </h1>
            </div>


            {(typeof data === "undefined") ? (
                <p> Loading...</p>
            ) : (

                data.map((item, i) => (

                    <div>
                        {(letter!==item[0][0]) ?
                            <h3>{item[0][0]}</h3> : "" }

                        {(letter!==item[0][0]) ? 
                            (letter=item[0][0],
                            <Togglebutton name={item} category_same={false} /> ): 
                            <Togglebutton name={item} category_same={true} />
                        }

                    </div>
                ))
            )}

            <button onClick={diagnose}>Done</button>
        </div>
    );
}

export default Diagnose;
